import React, { Component } from 'react';
import './App.css';
import SideBar from './componentes/SideBar';
import {BrowserRouter, Route} from 'react-router-dom'




class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Route path="/home" Component={SideBar}/>
      </BrowserRouter>
    );
  }
}

export default App;
